import React from "react";

function Food({ name }) {
  return <h3>I love {name}</h3>;
}

const foodLike = [
  {
    id: 1,
    name: "kimchi",
  },

  {
    id: 2,
    name: "samgyeopsal",
  },
];

function App() {
  return (
    <div>
      {foodLike.map((dish) => (
        <Food key={dish.key} name={dish.name} />
      ))}
    </div>
  );
}

export default App;
